    "# [1]: Load Data\n",
    "delhi_train <- read.csv('/kaggle/input/nich-datasets/DailyDelhiClimateTrain.csv')\n",
    "delhi_test <- read.csv('/kaggle/input/nich-datasets/DailyDelhiClimateTest.csv')\n",
    "list.files(path = \"../input\")\n",
    "\n",
    "# Format Date\n",
    "delhi_train$date <- as.Date(delhi_train$date, format = \"%Y-%m-%d\")\n",
    "delhi_test$date <- as.Date(delhi_test$date, format = \"%Y-%m-%d\")\n",
    "\n",
    "delhi_train <- delhi_train %>%\n",
    "    group_by(date = format(date, \"%Y-%m-01\")) %>%\n",
    "    summarize(meantemp = mean(meantemp, na.rm = TRUE), humidity = mean(humidity, na.rm = TRUE), wind_speed = mean(wind_speed, na.rm = TRUE), meanpressure = mean(meanpressure, na.rm = TRUE))\n",
    "\n",
    "delhi_test <- delhi_test %>%\n",
    "    group_by(date = format(date, \"%Y-%m-01\")) %>%\n",
    "    summarize(meantemp = mean(meantemp, na.rm = TRUE), humidity = mean(humidity, na.rm = TRUE), wind_speed = mean(wind_speed, na.rm = TRUE), meanpressure = mean(meanpressure, na.rm = TRUE))\n",
    "\n",
    "# Format Date\n",
    "delhi_train$date <- as.Date(delhi_train$date, format = \"%Y-%m-%d\")\n",
    "delhi_test$date <- as.Date(delhi_test$date, format = \"%Y-%m-%d\")\n",
    "\n",
    "str(delhi_train)"
   ]
  },
