   "source": [
    "# Autoarima automatically fixes stationarity and seasonality:\n",
    "delhi_auto <- auto.arima(ts(delhi_train$meantemp, start = c(2013, 1, 1), frequency = 12))\n",
    "delhi_auto\n",
    "\n",
    "# Verify Stationarity\n",
    "adf.test(delhi_auto$residuals)\n",
    "\n",
    "# Verify ACF/PACF \n",
    "acf(delhi_auto$residuals, main = \"Delhi ACF AutoArima\")\n",
    "pacf(delhi_auto$residuals, main = \"Delhi PACF AutoArima\")"
   ]
  },
