   "source": [
    "L <- 49                          # length of Test_data\n",
    "H <- 4                        # length of Train_data\n",
    "\n",
    "### Predict (tmp_auto) for 21 periods\n",
    "delhi_pred <- predict(delhi_auto, n.ahead = H)\n",
    "\n",
    "### Extract \"pred\" values from \"auto_pred\" and add them to dataframe\n",
    "delhi_graph <- data.frame(\n",
    "    date      = seq(as.Date(\"2013-1-1\"), by = \"month\", length.out = 53),\n",
    "    mt_train  = c(delhi_train$meantemp, rep(NA, H)),\n",
    "    mt_test   = c(rep(NA, L), delhi_test$meantemp),\n",
    "    pred_auto = c(rep(NA, L), delhi_pred$pred),\n",
    "    pred_l    = c(rep(NA, L), delhi_pred$pred - 1.96*delhi_pred$se),\n",
    "    pred_u    = c(rep(NA, L), delhi_pred$pred + 1.96*delhi_pred$se))\n",
    "\n",
    "# Add lim\n",
    "delhi_graph$lim <- ifelse(delhi_graph$date>= \"2017-02-01\", 1,0)"
   ]
