    "###\n",
    "ggplot() +\n",
    "  geom_line(data = delhi_graph %>% filter(lim == 0), aes(x = date, y = mt_train, color = \"Train\", group = 1)) +\n",
    "  geom_line(data = delhi_graph %>% filter(lim == 1), aes(x = date, y = mt_test, color = \"Test\", group = 1)) +\n",
    "  geom_line(data = delhi_graph %>% filter(lim == 1), aes(x = date, y = pred_u, color = \"Upper bound\")) +\n",
    "  geom_line(data = delhi_graph %>% filter(lim == 1), aes(x = date, y = pred_l, color = \"Lower bound\")) +\n",
    "  geom_line(data = delhi_graph %>% filter(lim == 1), aes(x = date, y = pred_auto, color = \"auto.arima\")) +\n",
    "  geom_vline(xintercept = as.Date(\"2017-02-01\"), linetype = \"dashed\") +\n",
    "  scale_x_date(date_labels = \"%Y\", date_breaks = \"1 year\") +\n",
    "  theme_minimal() +\n",
    "  theme(legend.position = \"bottom\", legend.title = element_blank())"
   ]
